import Link from 'next/link';

const Header = () => (
  <ul className="flex">
    <Link href="/" className="mr-6">
      <a className="text-blue-500 hover:text-blue-800" href="#">Home</a>
    </Link>
    <li className="mr-6">
      <Link href="/about">
        <a className="text-blue-500 hover:text-blue-800" href="#">About</a>
      </Link>
    </li>
  </ul>
);

export default Header;
